import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  onScanclick = (event) => {
    event.preventDefault();
    event.stopPropagation();
    console.log("scan clicked");
  };

  render() {
    return (
      <div>
        <button onClick={this.onScanclick()}>Scan</button>
        <button>Enter</button>  
      </div>
    );
  }
}

export default App;
